import { Col, Container, Row } from 'react-bootstrap';

function ProfilePage() {
  return (
    <Container
      fluid
      style={{
        backgroundImage:
          'url(https://images.pexels.com/photos/1379636/pexels-photo-1379636.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1)',
        backgroundSize: 'cover',
        minHeight: '100vh',
      }}
    >
      <Row style={{ minHeight: '100vh' }} className="w-100  d-flex justify-content-center align-items-center">
        <Col
          md={4}
          className="p-5"
          style={{ backgroundColor: '#fff', borderRadius: '10px', boxShadow: '0 2px 5px #333' }}
        >
          <div className="d-flex justify-content-center">
            <img
              width={120}
              height={120}
              style={{ borderRadius: '50%' }}
              src="https://i.pinimg.com/736x/c6/e5/65/c6e56503cfdd87da299f72dc416023d4.jpg"
              alt=""
            />
          </div>
          <row></row>
        </Col>
      </Row>
    </Container>
  );
}

export default ProfilePage;
